import NAVCARDDROPDOWN from "./NavCardDropDown.module.css";
const NavCardDropDown = ({ items }) => {
  return (
    <div className={NAVCARDDROPDOWN.container}>
      <div>{items.content}</div>
    </div>
  );
};
export default NavCardDropDown;
